import React, { useState, useEffect } from "react";
import "./StockManagement.css";

const StockManagement = () => {
  const [stock, setStock] = useState([]);
  const [newItem, setNewItem] = useState({ name: "", quantity: "", price: "", supplier: "" });

  // Load stock from local storage when component mounts
  useEffect(() => {
    const savedStock = JSON.parse(localStorage.getItem("stock")) || [];
    setStock(savedStock);
  }, []);

  // Save stock to local storage whenever it changes
  useEffect(() => {
    localStorage.setItem("stock", JSON.stringify(stock));
  }, [stock]);

  // Add new stock item
  const addStock = () => {
    if (!newItem.name || !newItem.quantity || !newItem.price || !newItem.supplier) {
      alert("Please fill all fields!");
      return;
    }
    
    setStock([...stock, { ...newItem, id: Date.now() }]);
    setNewItem({ name: "", quantity: "", price: "", supplier: "" });
  };

  // Delete stock item
  const deleteStock = (id) => {
    setStock(stock.filter((item) => item.id !== id));
  };

  // Check for low-stock items
  const lowStockItems = stock.filter((item) => item.quantity < 10);

  return (
    <div className="stock-container">
      <h2>Stock Management</h2>

      <div className="add-stock">
        <input type="text" placeholder="Name" value={newItem.name} onChange={(e) => setNewItem({ ...newItem, name: e.target.value })} />
        <input type="number" placeholder="Quantity" value={newItem.quantity} onChange={(e) => setNewItem({ ...newItem, quantity: e.target.value })} />
        <input type="number" placeholder="Price" value={newItem.price} onChange={(e) => setNewItem({ ...newItem, price: e.target.value })} />
        <input type="text" placeholder="Supplier" value={newItem.supplier} onChange={(e) => setNewItem({ ...newItem, supplier: e.target.value })} />
        <button onClick={addStock}>Add Stock</button>
      </div>

      {lowStockItems.length > 0 && (
        <div className="low-stock-alert">
          <h3>⚠ Low Stock Alert!</h3>
          <ul>
            {lowStockItems.map((item) => (
              <li key={item.id}>{item.name} is running low ({item.quantity} left).</li>
            ))}
          </ul>
        </div>
      )}

      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Quantity</th>
            <th>Price</th>
            <th>Supplier</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {stock.map((item) => (
            <tr key={item.id}>
              <td>{item.name}</td>
              <td>{item.quantity}</td>
              <td>₹{item.price}</td>
              <td>{item.supplier}</td>
              <td><button onClick={() => deleteStock(item.id)}>Delete</button></td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default StockManagement;
